import React, { useEffect, useState } from 'react';
import api from '../services/api';
import TenantLeaseCard from '../components/TenantLeaseCard';
import TenantPayments from '../components/TenantPayments';
import SmartLockAccess from '../components/SmartLockAccess';
import TenantReminders from '../components/TenantReminders';

export default function TenantDashboard() {
  const [user, setUser] = useState(null);

  useEffect(() => {
    api.get('/auth/profile')
      .then(res => setUser(res.data))
      .catch(() => setUser({ error: true }));
  }, []);

  if (!user) return <p>Loading...</p>;
  if (user.error) return <p>Unauthorized. Please log in.</p>;

  return (
    <div style={containerStyle}>
      <h2>Welcome, {user.name}</h2>
      <TenantLeaseCard userId={user.id} />
      <TenantPayments userId={user.id} />
      <SmartLockAccess userId={user.id} />
      <TenantReminders userId={user.id} />
    </div>
  );
}

const containerStyle = {
  padding: '2rem',
  fontFamily: 'Segoe UI, sans-serif'
};
